import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

import ImageContainer from "./components/ImageContainer/image-container.components";
import ImageDetails from "./pages/image-details.component";

import "./App.css";

const App = () => (
  <div className="max-w-1200 mx-auto">
    <Switch>
      <Route exact path="/">
        <ImageContainer />
      </Route>
      <Route path="/image/:slug">
        <ImageDetails />
      </Route>
    </Switch>
  </div>
);

export default App;
